import {BrowserRouter, Link, Switch, Route} from "react-router-dom";

import {home} from "component/pages/home";
import {profile} from "component/pages/profile";
import {skill} from "component/pages/skill";
import {product} from "component/pages/product";
import {contact} from "component/pages/contact";

export function App (){
  return (
      <BrowserRouter>
      <div className="App">
      <Link to="component/pages/home">Home</Link>
      <br />
      <Link to="component/pages/profile">Profile</Link>
      <br />
      <Link to="component/pages/skill">Skill</Link>
      <br />
      <Link to="component/pages/product">Product</Link>
      <br />
      <Link to="component/pages/contact">Contact</Link>
      <br />
    </div>
    <Switch>
        <Route exact path="component/pages/home"component={home}>
        </Route>
        <Route path="component/pages/profile"component={profile}>
        </Route>
        <Route path="component/pages/skill"component={skill}/>
        <Route path="component/pages/product"component={product}/>
        <Route path="component/pages/contact"component={contact}/>
    </Switch>
    </BrowserRouter>
  );
};
